INSERT INTO `noticias` VALUES (3,'Samsung anuncia una nueva cámara de Realidad Virtual','samsung-anuncia-una-nueva-camara-de-realidad-virtual','<p>La competencia continua para calentar en el mercado de teléfonos móviles, <em>Samsung Electronics</em> se basa en gran medida de la realidad virtual para ayudar a distinguir sus teléfonos inteligentes.</p>\r\n<p><img src=\"/img/sansung_nueva_camara_360.jpg\" alt=\"camara \" width=\"100%\"></p>\r\n<p>El fabricante de Corea del Sur, que es el fabricante por de teléfonos más grande del mundo, el domingo anunció dos nuevos teléfonos inteligentes Galaxy junto con el engranaje 360, una cámara para grabar vídeos de realidad virtual. La compañía hizo los anuncios en el Mobile World Congress, uno de los eventos más grandes de la industria tecnológica para productos móviles, que se celebró en Barcelona.</p>\r\n<p>El engranaje 360 acompaña de Samsung Gear VR, los auriculares de realidad virtual que la compañía desarrolló con Oculus de <em>Facebook</em>, que fue lanzado en noviembre. El engranaje 360 tiene dos cámaras (una en la parte delantera y uno en la parte posterior) para permitir a los consumidores grabar vídeos de 360 grados. Los videos se pueden ver a través del engranaje VR, que sólo funciona con los teléfonos Galaxy de Samsung.</p>\r\n<p>En cuanto a los teléfonos - el Galaxy S7, con una pantalla de 5,1 pulgadas, y el borde de la galaxia S7, con una pantalla curva de 5,5 pulgadas - no hay mucho nuevo acerca de ellos. Los dispositivos son hasta cinco pies de profundidad y resistente al agua y las cámaras se han mejorado para enfocar automáticamente en las imágenes más rápido. Los aparatos también tienen lo que Samsung llama pantallas siempre-en que se iluminan constantemente sólo los píxeles necesarios para mostrar las notificaciones de hora o calendario; se apaga cuando el teléfono está escondido en un bolsillo o en el bolso.</p>\r\n<p>Con la falta de nuevas funciones del teléfono, Samsung está apostando duro en la realidad virtual para ayudar a mantener su ventaja.</p>\r\n<p>\"Samsung continúa empujando los límites de la experiencia móvil para extender más allá del teléfono inteligente\", D. J. Koh, un ejecutivo de Samsung, dijo en un comunicado.</p>\r\n<p>En el cuarto trimestre del año pasado, Samsung tenía un 21,4 por ciento del mercado de teléfonos inteligentes, seguido por Apple con un 18,7 por ciento, según la firma de investigación IDC. Cabe destacar que el fabricante de teléfonos chino Huawei creció ventas de unidades en más de un tercio de agarrar la cuota de mercado del 8,1 por ciento.</p>\r\n<p>\"Por lo general, la conversación en el mercado de teléfonos inteligentes gira en torno a Samsung y Apple, pero fuerte presencia de Huawei, tanto para el trimestre y el año hablan de lo mucho que ha crecido como una marca internacional,\" Melissa Chau, un gerente de investigación de IDC, dijo en una declaración.</p>\r\n<p>Samsung no reveló detalles de precios en los productos nuevos. Los teléfonos serán publicados el 11 de marzo en los Estados Unidos, y estarán disponibles el engranaje 360 a finales de este año.</p>','2016-02-01 00:00:00','2016-02-20 16:28:26',2,5,'samsung,realidad virtual,camara de realidad virtual,moviles',1,1,86,38),(4,'10 tips que mejoraran la señal wifi en tu casa','10-tips-que-mejoraran-la-senal-wifi-en-tu-casa','<p>Todos sabemos lo molesto y desesperante que puede ser tener una conexión lenta a Internet, especialmente cuando nos urge terminar el reporte que debemos enviar esa misma noche, o cuando estamos disfrutando de una película online y de pronto se nos aparece la ruleta de la muerte en el reproductor de video.</p>\r\n<p><img src=\"/img/10_tips_para_mejorar_wifi_wen_casa.jpg\" alt=\"wifi\" width=\"350\" height=\"221\"></p>\r\n<p>En estos casos, lo único que queremos hacer es llorar o azotar la computadora hasta hacerla trizas, pero recuerden que la paciencia de una persona se mide de acuerdo a su actitud frente a una computadora con lenta conexión, así que tranquilos, respiren profundo y tomen nota, porque les traemos 10 tips que ayudarán a mejorar la señal de WiFi en su casa.</p>\r\n<p>Si con esto no es suficiente, tal vez deban considerar cambiar de enrutador o de servicio de Internet. Todos sabemos lo molesto y desesperante que puede ser tener una conexión lenta a Internet, especialmente cuando nos urge terminar el reporte que debemos enviar esa misma noche, o cuando estamos disfrutando de una película online y de pronto se nos aparece la ruleta de la muerte en el reproductor de video.</p>\r\n<p>En estos casos, lo único que queremos hacer es llorar o azotar la computadora hasta hacerla trizas, pero recuerden que la paciencia de una persona se mide de acuerdo a su actitud frente a una computadora con lenta conexión, así que tranquilos, respiren profundo y tomen nota, porque les traemos 10 tips que ayudarán a mejorar la señal de WiFi en su casa. Si con esto no es suficiente, tal vez deban considerar cambiar de enrutador o de servicio de Internet.</p>\r\n<p> </p>\r\n<p> </p>\r\n<p> </p>','2016-01-28 00:00:00','2016-02-19 16:26:15',2,2,'10-tips,mejoraran-la-senal-wifi,mejoraran,señal wifi',1,1,79,39),(5,'Los 10 idiomas más difíciles de aprender','los-10-idiomas-mas-complicados-de-aprender','<p>El <em>Foreign Service Institute </em>(Instituto de Servicio Exterior del Departamento de Estado) en Estados Unidos ha creado una lista con los 10 idiomas más difíciles de aprender. </p>\r\n<p><img src=\"/img/Los-10-idiomas-mas-dificiles-de-aprender.jpg\" alt=\"idiomas\" width=\"100%\"></p>\r\n<p><strong>1.- Joponés</strong> </p>\r\n<p>Horas de clase: 2.200</p>\r\n<p>Número de hablantes nativos: 122 millones</p>\r\n<p>País con la mayor cantidad de hablantes: Japón</p>\r\n<p>Para aprender japonés hay que memorizarse miles de caracteres y contenido con tres sistemas diferentes de escritura (Kanji, Hiragana y Katakana) y un sistema numérico con dos pronunciaciones diferentes. El japonés fue una vez clasificado como una lengua aislada (un idioma natural sin ninguna relación genealógica a los demás idiomas) pero ahora se clasifica como una parte de la pequeña familia japónica junto a las lenguas Ryukyuan, perteneciente a las islas Ryukyu en Japón</p>\r\n<p>Además de eso, el japonés es un idioma que depende del contexto. La manera en que hablan las mujeres con amigos y familia es diferente a la manera de hablar de los hombres y niños, así que deben escoger las palabras con mucho cuidado para evitar ser irrespetuoso.</p>\r\n<p>Un hecho: La mayor cantidad de personas que hablan japonés fuera de Japón se encuentran en Brasil y suman aproximadamente 1.5 millones de personas.</p>\r\n<p><strong>2.- Chino (Mandarín y Cantonés)</strong></p>\r\n<p>Número de hablantes nativos: 1,2 billones</p>\r\n<p>País con la mayor cantidad de hablantes: China</p>\r\n<p>El chino también requiere aprender miles de caracteres. Se dice que conocer 3mil caracteres te permitirá leer un periódico mientras que una persona de muy buena educación puede entender 8mil caracteres – ¡de más de 50mil!</p>\r\n<p>Otra dificultad del idioma es que el significado de las palabras cambia dependiendo del tono en el que se diga. Además de eso, el idioma es poco intuitivo por lo que la débil fonética del idioma nunca te dará ese recuerdo constante que da el inglés o el español, lo que hace que en ocasiones puedas olvidarte completamente de cómo escribir un carácter.</p>\r\n<p>Un hecho: aproximadamente una de cada 5 personas habla algún tipo de chino.</p>\r\n<p><strong>3.- Coreano</strong></p>\r\n<p>Fuente</p>\r\n<p>Horas de clase: 2.200</p>\r\n<p>Número de hablantes nativos: 166,3 millones</p>\r\n<p><br>País con la mayor cantidad de hablantes: Corea del Sur</p>\r\n<p>El idioma coreano tiene dos sistemas numéricos diferentes y ninguna relación con otros idiomas, por lo que es un idioma aislado.</p>\r\n<p>Similar al japonés, el coreano también es un idioma contextual. Una oración puede decirse de tres maneras diferentes dependiendo de la relación entre el hablante y el oyente. Tal vez lo más complejo del idioma es que un verbo puede conjugarse en más de 100 maneras. Y peor aún, los adjetivos también se conjugan.</p>\r\n<p>Un hecho: La palabra en coreana para “Navaja Swiss army” es “maekgaibeo kal”. Kal es una palabra coreana pero “maekgaibeo” viene aparentemente de una serie de TV de los 80s llamada MacGyver en donde un agente secreto utilizaba una navaja Swiss army y cinta adhesiva para escapar de situaciones complicadas.</p>\r\n<p><strong>4. Árabe</strong></p>\r\n<p>Horas de clase: 2.200</p>\r\n<p><br>Número de hablantes nativos: 221 millones</p>\r\n<p>País con la mayor cantidad de hablantes: Egipto</p>\r\n<p>El alfabeto árabe es mucho más pequeño que el chino o el japonés pero puede ser igual de intimidante. Su caligrafía cursiva se compone de 28 letras complementadas por 3 vocales pero la mayoría de las letras toman 4 formas distintas dependiendo de si están solas, o al comienzo, final o intermedio de una oración.</p>\r\n<p>Además, la idiosincracia de la pronunciación árabe puede ser difícil de manejar, más comúnmente el sonido ´ayn conocido formalmente como “fricativa faríngea sonora”. También cabe acotar que un verbo árabe en tiempo presente tiene 13 formas combinando a la persona (primera, segunda o tercera), número (singular, dual o plural) y género (femenino o masculino)</p>\r\n<p>Un hecho: La forma más antigua de literatura árabe es la poesía, lo cual tiene mucho sentido considerando lo bello que es el idioma.</p>\r\n<p><strong>5. Estonio</strong></p>\r\n<p>Horas de clase: 1.100<br>Número de hablantes nativos: 1,2 millones</p>\r\n<p>País con la mayor cantidad de hablantes: Estonia</p>\r\n<p>El estonio se considera un idioma difícil porque maneja 14 casos de sustantivos. Sólo imagina el uso de pronombres “yo”, “él”, “nosotros” multiplicado por 14 formas.</p>\r\n<p>Las consonantes y las vocales vienen en 3 longitudes (corto, largo y muy largo), y generalmente cambian el significado de las palabras (lina es ‘hilo’ mientras que linna es ‘ciudad’). Además, el estonio tiene 25 diptongos y muchas excepciones a reglas de gramática definidas.</p>\r\n<p>Un hecho: Estonia es el segundo país con mayor alfabetismo alrededor del mundo con 99,8%, ubicándose encima de Reino unido (99%), Canadá (99%) y Australia (96%).</p>\r\n<p><strong>6. Finlandés</strong></p>\r\n<p>Horas de clase: 1.100</p>\r\n<p>Número de hablantes nativos: 5 millones</p>\r\n<p>País con la mayor cantidad de hablantes: Finlandia</p>\r\n<p>El finlandés se encuentra en la misma familia de idiomas que el estonio y el húngaro. A pesar de haberse originado en Europa, esta familia de idiomas no tiene influencias germánicas ni latinas lo que hace el aprendizaje aún más difícil.</p>\r\n<p><strong>7. Húngaro</strong></p>\r\n<p>Horas de clase: 1.100</p>\r\n<p>Número de hablantes nativos: 13 millones</p>\r\n<p>País con la mayor cantidad de hablantes: Hungría</p>\r\n<p>En el idioma húngaro, posesión, tiempo verbal y número son indicados por 18 casos sufijos en lugar del orden de las palabras. Esto quiere decir que una oración puede tomar varios significados si los sufijos son ligeramente alterados.</p>\r\n<p>El húngaro tiene muchos sonidos de vocales únicos (á,é,ó,ö,?,ú,ü,?,í) y pares de consonantes (ty, gy, ny, sz, zs, dzs, dz, ly, cs) haciendo difícil la lectura y la pronunciación a pesar de su utilización del alfabeto latino.</p>\r\n<p>Un hecho: Se dice que uno de los fragmentos más antiguos del húngaro fue encontrado en Nueva Escocia tallado en la Piedra Runic. Esto aún no ha sido confirmado pero, de ser cierto, probaría que los exploradores europeos llegaron a las Américas mucho antes que colón.</p>\r\n<p><strong>8. Mongol</strong></p>\r\n<p>Horas de clase: 1.100</p>\r\n<p>Número de hablantes nativos: 5,7 millones</p>\r\n<p>País con la mayor cantidad de hablantes: Mongolia / Mongolia Interior</p>\r\n<p>El sistema de escritura mongol ha evolucionado por varias iteraciones y actualmente viene en dos formas principales: el alfabeto mongol tradicional que se lee verticalmente y es utilizado en Mongolia Interior, y el alfabeto cirílico que se lee horizontalmente y se usa en la vida cotidiana y en internet.</p>\r\n<p>El mongol es difícil porque también opera en diferentes casos. 8 casos son utilizados y distinguidos por sufijos. Cambios a estos sufijos pueden cambiar el sentido completo de una oración.</p>\r\n<p>Un hecho: El texto más antiguo conocido en la Antigua Mongolia es La Estela de Yisungge que se ubica alrededor de 1224AD. No es un texto religioso sino un reporte de las hazañas de Yisungge, el sobrino de Genghis Khan, en tiro al arco.</p>\r\n<p><strong>9. Vietnamita</strong></p>\r\n<p>Horas de clase: 1.100</p>\r\n<p>Número de hablantes nativos: 68,6 millones</p>\r\n<p>País con la mayor cantidad de hablantes: Vietnam</p>\r\n<p>Similar al chino, el vietnamita es un idioma tonal. Hay 6 tonos indicados por símbolos diferentes (un acento grave, un acento agudo, un gancho, una tilde o un punto debajo de una palabra). Existen diferentes encarnaciones de una misma palabra, cada una de las cuales cambia de significado a través del tono. Esto quiere decir que oraciones como “Ban b?n bán bàn b?n” tienen sentido gramatical (“Amigo Ban vende mesas sucias”). Los aprendices de esta lengua no sólo deben memorizarse las marcas escritas sino aprender a reconocer los distintos tonos hablados.</p>\r\n<p>Un hecho: El vietnamita es un lenguaje de minoría oficialmente reconocido en República Checa.</p>\r\n<p><strong>10. Tailandés</strong></p>\r\n<p>Horas de clase: 1.100</p>\r\n<p>Número de hablantes nativos: 20,4 millones</p>\r\n<p>País con la mayor cantidad de hablantes: Tailandia</p>\r\n<p>El tailandés es otro de los idiomas tonales. Utiliza 5 tonos diferentes que pueden cambiar el contexto de lo que se está diciendo.</p>','0000-00-00 00:00:00','2016-02-20 16:29:15',2,3,'idioma dificil aprender,idioma,aprender,japones,chino,cantones,coreano,arabe,estonio,filandes,hungaro,mongol,vietnamita,tailandes',1,1,119,15),(8,'Se filtran detalles del nuevo iPhone de cuatro pulgadas','se-filtran-detalles-nuevo-iphone-de-cuatro-pulgadas','<p>Durante las últimos meses diversos rumores han indicado que Apple estaría por lanzar un nuevo teléfono, en esta oportunidad con una pantalla más pequeña que los modelos actuales. Sin embargo, nuevos reportes aseguran que al menos su procesador se mantendría en una nueva generación, publica América Economía</p>\r\n<p><img src=\"/img/iphone_4_pulgadas.jpg\" alt=\"iphone 4 pulg\" width=\"300\" height=\"141\"></p>\r\n<p>Según reveló el medio Bloomberg, si bien el próximo teléfono de Apple volvería al pasado con una pantalla de 4 pulgadas su procesador correspondería a la nueva generación A9. Este rumor confirma los reportes previos del medio 9to5Mac donde aseguraban, además, que el teléfono llevaría el nombre de iPhone 5SE como una continuación del tamaño de este modelo.</p>\r\n<p>Además el equipo vendría integrado con NFC para el sistema Apple Pay y la nueva herramienta Live Photos presente en los teléfonos iPhone 6S y 6S Plus. No obstante, no contaría con el sistema 3D Touch de estos últimos modelos.</p>','2016-02-21 14:51:52','2016-02-21 16:18:17',2,5,'nuevo-iphone,iphone,iphone-de-cuatro-pulgadas',1,1,84,37),(9,'El reto de almacenar la energía','el-reto-de-almacenar-la-energia','<p><strong><u>EMPRENDEDORES</u></strong></p>\r\n<p><strong><u><img src=\"/img/reto_de_almacenar_energia.jpg\" alt=\"img1\" width=\"100%\"></u></strong></p>\r\n<p>EUGENIO DOMÍNGUEZ Fundador de Win Inertia conversa sobre la importancia de almacenar energía en estos tiempos.</p>\r\n<p>\"Es una pena que muchos buenos proyectos se queden en papel o en prototipos cuando sabes que tienen una salida real al mundo\". Cansado de ver cómo muchas ideas de negocio se quedaban en un cajón, Eugenio Domínguez decidió dar el salto del mundo académico al empresarial y fundó en 2008 <a href=\"http://wininertia.es/\" target=\"_blank\">Win Inertia</a>, una \'spin-off\' de la Universidad de Sevilla que se encarga de recuperar la energía que se pierde cuando la red eléctrica no da abasto para almacenarla en vez de quemarla, como ocurría hasta el momento.</p>\r\n<p>En Win Inertia están especializados en electrónica de potencia, energía y estrategias de control, desarrollando tecnología destinada a la generación, transmisión, almacenamiento y gestión de la energía. Sus soluciones se adaptan a diferentes sectores, aunque el almacenamiento de energía es su mayor éxito.</p>\r\n<p>En esta joven empresa tienen claro que el almacenamiento energético en redes es la pieza clave que va a permitir el uso de las redes inteligentes y la mejora del sistema, al aportar mayor sostenibilidad a la red. \"No sirve de nada instalar muchas renovables o tecnologías de la información en tu empresa si no puedes gestionar toda esa cantidad de energía que generas\", advierte Domínguez.</p>\r\n<p>Este hecho se debe a que las fuentes de energía renovable se basan en elementos naturales que el usuario no puede regular, como el sol o el viento, por lo que \"la única forma de gestionar la energía y poder aumentar la capacidad de la red es a través del almacenamiento de la misma\", explica el fundador de la compañía sevillana.</p>\r\n<p><strong>Ventas reactivas</strong></p>\r\n<p>En estos últimos años ha tenido lugar una explosión de las energías renovables que muchas empresas han querido aprovechar. Sin embargo, son energías difícilmente gestionables, por lo que la idea de Win Inertia de convertirse en el engranaje que las consigue integrar en la red según las necesidades de consumo de cada momento ha tenido un éxito destacable. La empresa, a pesar de nacer en un momento turbulento de la economía, ha logrado comenzar a consolidar su facturación en 2014, llegando a los 2,5 millones de euros.</p>\r\n<p>\"Nuestra facturación del último año la hemos conseguido sin realizar una venta activa, sino más reactiva. Es decir, varias personas nos encargaban proyectos, pero mientras estábamos desarrollando nuestras tecnologías estrella para competir en el mercado global\", explica Domínguez. El director general asegura que a partir de este año es cuando podrán ver \"exactamente\" cuál es su volumen de negocio, aunque confían en duplicar la facturación a final de 2015. \"El objetivo es llegar a los 15 millones de euros de facturación anual en 2017\".</p>\r\n<p>La empresa ha tenido que acudir al mercado extranjero ante la caída de las renovables por la crisis económica</p>\r\n<p>Hoy su tecnología se vende sobre todo en Estados Unidos, que es \"el mercado que ha tomado el liderazgo\" en la optimización energética de las redes, \"a pesar de que hace años vivían a remolque de Europa en el tema de las renovables\", reconoce Domínguez. Pero, ¿cómo entrar en ese país y hacer frente a gigantes tecnológicos ya asentados? \"Hemos buscado socios norteamericanos para acudir a presentar proyectos de forma conjunta para facilitar el trabajo, aunque nos ha requerido mucho esfuerzo porque no tiene nada que ver trabajar en casa que en California\".</p>\r\n<p><strong>Latinoamérica y Asia</strong></p>\r\n<p>El objetivo a corto plazo es conquistar Latinoamérica y el Sudeste asiático. En cambio, entrar en Europa se lo toman con más calma porque \"a día de hoy este mercado va bastante más lento por la propia concepción de las redes eléctricas en Europa\", dice el cofundador de Win Inertia, aunque anuncia que entre 2018 y 2020 esta tecnología aterrizará en nuestro continente y para entonces ellos ya estarán \"posicionados en el resto del mundo\" y \"totalmente preparados\" para enfrentarse al reto.</p>','2016-02-21 15:04:49','2016-02-21 16:28:54',2,5,'reto, almacenar, energía, emprendedores, potencia, tecnología, energético, empresa,renovables, latino américa, asia',1,1,103,6),(10,'Appvise, la aplicación para erradicar el bullying de los colegios','appvise-la-aplicacion-para-erradicar-el-bullying-de-los-colegios','<p>La nueva aplicación Appvise es un servicio integral tecnológico y social, un proyecto que se implantará en los centros precursores en tecnología en España en los próximos meses, según afirma la compañía.</p>\r\n<p><img src=\"/img/appvise_aplicacion_contra_el_bullying.jpg\" alt=\"bulying\" width=\"321\" height=\"180\"></p>\r\n<p>Este proyecto de tecnología móvil con enfoque social cuenta con una herramienta de comunicación que facilitará la conexión entre padres, profesores y alumnos. Entre otras cosas, incluye funciones de localización, seguimiento del rendimiento y calificaciones del alumno o de denuncia anónima en casos de bullying.</p>\r\n<p> Asimismo, el servicio ofrece llevar a cabo talleres educativos sobre diversidad cultural, protección del medioambiente y derechos humanos con el fin de erradicar, en conjunto con organizaciones sin ánimo de lucro expertas, los posibles casos identificados a través de la aplicación.</p>\r\n<p>Appvise también colabora con la Fundación Sueña un Sueño en Colombia quienes desarrollan proyectos educativos con niños y mayores en poblaciones vulnerables y otras organizaciones en España como parte de su plan de responsabilidad social y medioambiental.</p>\r\n<p>Este es un proyecto desarrollado por Integra Technologies, empresa de innovación tecnológica perteneciente al grupo CHT Holdings con sedes en Delaware (EE UU) y Malta.</p>','2016-02-21 16:16:45','2016-02-18 16:29:31',2,5,'Aplicación, erradicar, bullying, colegios, proyecto, España, tecnología, móvil, educativos',1,1,69,40),(11,'Comienza el proyecto de Google para proveer internet desde la estratosfera','comienza-el-proyecto-de-google-para-proveer-internet-desde-la-estratosfera','<p>Con el objetivo de que cada vez más personas puedan estar conectadas a internet, sobre todo pensando en lugares del planeta donde nadie tiene conexión, nace el Proyecto Loon de Google, que ya ha comenzado a materializarse.</p>\r\n<p>El primer globo en los que se basa este proyecto, con equipamiento para proveer internet desde la estratosfera, ha llegado ya a Sri Lanka para comenzar las pruebas comerciales en esta isla del Índico.</p>\r\n<p><img src=\"/img/globos_de_google_a_la_estratosfera.jpg\" alt=\"globos\" width=\"100%\"></p>\r\n<p>El Proyecto Loon se compone de una red de globos que viajará sobre el límite con el espacio exterior. Está pensado para conectar a las personas que habitan zonas remotas o rurales, para llegar a las zonas con falta de cobertura y para que las personas puedan volver a tener Internet después de una catástrofe\", dicen desde Google.</p>\r\n<p>“Google necesitará al menos trece de estos globos para conectar todo Sri Lanka”</p>\r\n<p>Los responsables del proyecto han explicado que las pruebas de servicio y de coordinación del espectro comenzarán la semana que viene. Las pruebas se desarrollarán durante doce meses antes de comenzar a operar comercialmente, ya que Google usará al menos trece de estos globos para conectar todo el país.</p>\r\n<p>Los globos del Proyecto Loon flotan en la estratósfera y superan dos veces la altura de los aviones y del clima. En la estratosfera hay muchas capas de viento, cada capa varía en dirección y velocidad, por lo que estos globos serán capaces de ascender o descender a la capa de viento que sopla en la dirección de viaje deseada para ir a donde ellos necesitan.</p>','2016-02-21 16:17:55','2016-02-17 16:49:03',2,5,'Proyecto, google, internet, estratosfera, planeta, globos, espacio',1,1,104,43),(12,'El teléfono celular más barato del mundo: a menos de $4','el-telefono-celular-mas-barato-del-mundo-a-menos-de-4-dolares','<p>Lanzan en la India un móvil que tiene varias características y que es considerado futurista.</p>\r\n<p>La compañía tecnológica india Ringing Bells, fundada el pasado año, presentó ayer su teléfono inteligente Freedom 251, el más barato del planeta, con un precio de 251 rupias o unos 3,7 dólares.</p>\r\n<p><img src=\"/img/celular_mas_barato_del_mundo.jpg\" alt=\"celular barato\" width=\"100%\"></p>\r\n<p>El dispositivo, que se podrá adquirir a partir de hoy a las en una página web creada exclusivamente para el producto, fue presentado al público en un evento en Nueva Delhi.</p>\r\n<p>El teléfono cuenta con una pantalla IPS de 4 pulgadas con resolución qHD, un procesador de cuatro núcleos que funciona a 1,3 gigaherzios, 1 giga de memoria RAM y 8 de memoria interna -ampliables a 32 gigas con una tarjeta Micro SD-.Según se explica, tiene una batería de 1.450 miliamperios e integra una cámara posterior de 3,2 megapíxeles con enfoque automático y otra frontal de 0,3 megapíxeles.</p>\r\n<p>La compañía asegura que el artefacto, funciona con sistema operativo Android 5.1 Lollipop, viene con garantía de un año, que se reduce a seis meses en el caso de la batería y el cargador y a tres meses para los auriculares.</p>\r\n<p>Actualmente, su página web cataloga únicamente tres modelos diferentes de teléfonos, todos agotados, y uno de cargador de baterías.    </p>','2016-02-21 16:20:12','2016-02-18 16:55:31',2,3,'Teléfono, celular, barato, la India, Freedom 251,Android, Lollopop',1,1,101,41),(13,'Los megalujos del pirata informático más poderoso del mundo','los-megalujos-del-pirata-informatico-mas-poderoso-del-mundo','<p>Kim Doctom, creador de la página web Megaupload, presentó un video en el que exhibe sus excentricidades amasadas en un millonario negocio que muchos consideran ilegal en la web.</p>\r\n<p>&lt;iframe src=\"//www.youtube.com/embed/oDiili2Gs-0\" width=\"100%\" height=\"314\" allowfullscreen=\"allowfullscreen\"&gt;&lt;/iframe&gt;</p>\r\n<p>Con el nombre de Good Life -La buena vida en español- Kim Dotcom evidencia fastuocidad, despilfarro y excentricidad con sus mansiones, yates, helicópteros, carros de lujo, fiestas y por supuesto hermosas mujeres.</p>\r\n<p>Kim Dotcom –un filandés-alemán de 42 años, o Kim Schmitz, como es su nombre real– fue condenado por fraude con tarjetas de crédito, piratería informática, abuso de información y malversación.</p>\r\n<p>Las autoridades de Estados Unidos acusaron a Megaupload de haberle causado más de 500 millones de pérdidas a la industria del cine y de la música al transgredir los derechos de autor de compañías y obtener con ello unos beneficios de 175 millones.</p>\r\n<p>\"Déjame introducirte a la buena vida, la buena vida\", así empieza la pegajosa canción.</p>\r\n<p>En la descripción del video se lee: \"Un niño gordo, expulsado del colegio y proveniente de una familia pobre hizo sus sueños realidad. Tú también puedes hacerlo\".</p>','2016-02-21 16:21:25','2016-01-31 17:10:02',2,3,'Megalujos, pirata, informático, ilegal, web, filandés, derechos de autor',1,1,102,22),(14,'El \'cerebro\' de España','el-cerebro-de-espana','<p>El último \"Nobel\" de supercomputación es Mateo Valero, un maño tozudo, cafetero «y del Barça», que estudió porque la maestra de su pueblo, Alfamén, convenció a sus padres. Hoy ese colegio lleva su nombre.</p>\r\n<p>De la misma manera que un computador no funciona sin energía, Mateo Valero no arranca sin un café. «Ristretto, por supuesto», su favorito «desde hace más de 20 años». Toma «doce al día», exagera. Cada jornada, se sienta en su despacho a eso de las 8.30 horas y tiene avisada a Lourdes, su «secre», para que le dé tregua hasta las once antes de sumergirle en el maremágnum de reuniones que tan poco le gustan. Le quitan tiempo para hacer eso por lo que le brillan los ojos: investigar. «Necesitaría una mañana entera, una tarde...», no el rato que hay entre cita y cita. Pero se tiene que repartir para llegar a todos los que le reclaman. Gajes del oficio.</p>\r\n<p><img src=\"/img/cerebro_de_espana.jpg\" alt=\"cerebro espana\" width=\"500\" height=\"291\"></p>\r\n<p>Valero, zaragozano de Alfamén, un pueblo de apenas 1.400 habitantes, es el director del Barcelona Supercomputing Center (BSC), algo así como el gran cerebro nacional de la investigación, y una eminencia mundial. A sus 63 años, es el pionero de la supercomputación en España, una disciplina que construye y trabaja con ordenadores de alto rendimiento, piedra angular de la nueva sociedad. Sirve para muchas cosas, entre ellas «para que tengas ese móvil de ahí», explica con tiento a los profanos. Hace unos meses, este «aragonés tozudo» sumó a su larga lista de premios uno más, el Seymour Cray, el \'Nobel\' de la supercomputación. Es el primer europeo que lo recibe.</p>\r\n<p>¡Es un genio!</p>\r\n<p>Qué va, jaja. No hay genios, hay equipos. Yo no soy tonto, pero tengo gente a mi alrededor que es más lista que yo.</p>\r\n<p>Se refiere a las 450 personas que integran la plantilla del BSC, un lugar que ahora es muy grande, pero que empezó como algo muy pequeñito allá por los setenta, cuando un Valero recién licenciado como \'teleco\' llega a la novísima Facultad de Informática de Barcelona. «Estaba todo por hacer y me permitieron empezar un departamento de arquitectura de computadores».</p>\r\n<p>La primera piedra virtual del Centro Nacional de Supercomputación se puso «en el año 84», cuando se consiguió algo que estos días adquiere un mayor significado: poner de acuerdo a la administración estatal y a la autonómica para que colaborasen en el proyecto. «Somos producto del consenso», se regocija. Hoy, en medio de la tormenta soberanista, esa unión se ha robustecido en noviembre. Y tira de refrán: «La unión hace la fuerza».</p>\r\n<p>En el BSC se investiga mucho y en múltiples campos: la medicina, el sector energético, el tecnológico... Se manejan muchos millones de euros para financiar estudios que podrían ayudarnos a conocer exactamente cómo se comporta el cáncer, cómo piensa nuestro cerebro, cómo se pueden hacer ordenadores potentísimos con piezas de móviles... Pero también se presta servicio a otros investigadores de fuera. Eso es cosa del MareNostrum, el supercomputador más potente de España y uno de los más importantes de Europa. «Nosotros solo usamos un 6%», el resto lo utilizan expertos de medio mundo.</p>','2016-02-21 16:22:46','2016-02-21 16:13:13',2,4,'cerebro, España, Nobel, Alfamén, supercomputadora, ordenadores, rendimiento, informática, Europa',1,1,95,36),(15,'La línea de metro sin conductor más larga de Europa se abre en Barcelona','la-linea-de-metro-sin-conductor-mas-larga-de-europa-se-abren-barcelona','<p>Siemens inaugura el nuevo tramo de la línea 9 de 19,6 km y 15 estaciones, que unirá Barcelona con su aeropuerto.</p>\r\n<p><img src=\"/img/linea_de_metro.jpg\" alt=\"metro\" width=\"100%\"></p>\r\n<p>La multinacional alemana Siemens acaba de inaugurar el nuevo tramo de la línea 9 del Metro de Barcelona entre Zona Universitaria y Aeropuerto de Barcelona-El Prat, que cuenta con los sistemas de señalización y operación automática sin conductor.</p>\r\n<p>El nuevo tramo, de 19,6 kilómetros y quince estaciones, se convierte en la línea sin conductor más larga de Europa, y dará servicio a más de 330.000 pasajeros al día. Cuando la línea 9 se ponga en servicio en su totalidad tendrá una longitud total de 50 km y 46 estaciones, lo que la convertirá en la línea automatizada más larga del mundo. Actualmente, el 25% de la red de metro de Barcelona opera ya sin conductor.</p>\r\n<p>Siemens ha desarrollado e instalado el sistema de señalización y control ferroviario de la línea, el Trainguard MT, un sistema CBTC (Communications Based Train Control) de operación automática sin conductor y basado en la comunicación vía radio entre el tren y la vía. Este sistema de conducción automática de Siemens está en servicio en los metros de París, Nueva York, Sao Paulo y Budapest, entre otros.</p>\r\n<p>El sistema Trainguard MT realiza de forma automática las funciones de arranque, supervisión de la velocidad, control de tracción y freno, parada, maniobra de vuelta en los terminales, así como la apertura y cierre de las puertas del tren y del andén. Asimismo, se ha implementado también una funcionalidad de marcha en deriva que incrementa la eficiencia energética.</p>\r\n<p>Así, se permite reducir el intervalo entre trenes manteniendo la total seguridad de la línea y aumentando así su capacidad, una funcionalidad especialmente importante en horas punta o en el caso de eventos de gran afluencia de viajeros.</p>','2016-02-21 16:23:57','2016-02-15 16:49:18',2,5,'Línea, metro, conductor, Europa, Barcelona, Siemens, tramo, señalización, ferroviario, andén, velocidad, viajeros',1,1,58,33),(16,'Redes sociales se catapultan como bolsas de empleo','redes-sociales-se-catapultan-como-bolsas-de-empleo','<p>Nueve de cada diez personas considerar que pueden usar las redes sociales para propósitos laborales. Así lo reveló la más reciente encuesta de Adecco Colombia sobre el impacto de estas plataformas y de internet en la búsqueda de empleo.</p>\r\n<p><img src=\"/img/redes_socailes_se_catapultan_como_bolsas_de_empleo.jpg\" alt=\"redes_sociales\" width=\"100%\" height=\"50%\"></p>\r\n<p>Según los resultados, las redes sociales son consideradas como una alternativa para buscar empleo por un 38 %, como una posibilidad ocasional en un 52% y no la consideran como una herramienta en un 10%.</p>\r\n<p>En cuanto a la efectividad, el 14 % de los entrevistados consiguió trabajo a través de redes sociales y el 49% fue llamado para un proceso de selección.</p>\r\n<p>Entre las redes, para encontrar trabajo, es común usar Facebook. Pero a medida que aumenta la edad es Linkedin la que va a adquiriendo mayor incidencia. Dos de cada 3 entrevistados que usan redes sociales para buscar trabajo tiene perfil en LinkedIn.</p>\r\n<p>En este sentido, Camilo Rico, Consultor Estratégico de Adecco Colombia, aseguró que \"éste primer aspecto es relevante, considerando que en Colombia existen alrededor de 11 millones de conexiones a Internet fijo, y alrededor de 24 millones de abonados a Internet. Esto nos indica que aproximadamente el 52% de la población tiene acceso a la red en nuestro país\".</p>\r\n<p>Otro tema de la encuesta es el de la generación de contenido en las redes sociales y la consecución de trabajo. El 35% piensa que lo publicado en las redes puede incidir en conseguir un empleo, mientras el 49% cree que influye pero no es decisivo.  Un 16% piensa que no influye.</p>\r\n<p>También se evaluó la percepción que se tiene de los portales especializados en búsqueda de empleo.  Tres de cada cuatro de los entrevistados confía en esta herramienta.</p>\r\n<p>Respecto a internet, los resultados muestran que el 99% de ellos ha usado internet para encontrar empleo. Y dos de tres consideran que ha sido realmente efectivo.</p>\r\n<p>En el sondeo se entrevistaron a hombres (51%) y mujeres (49%) en las diferentes regiones del país.</p>\r\n<p>Entre las redes, para encontrar trabajo, es común usar Facebook. Pero a medida que aumenta la edad es Linkedin la que va a adquiriendo mayor incidencia. Dos de cada 3 entrevistados que usan redes sociales para buscar trabajo tiene perfil en LinkedIn.</p>\r\n<p>En este sentido, Camilo Rico, Consultor Estratégico de Adecco Colombia, aseguró que \"éste primer aspecto es relevante, considerando que en Colombia existen alrededor de 11 millones de conexiones a Internet fijo, y alrededor de 24 millones de abonados a Internet. Esto nos indica que aproximadamente el 52% de la población tiene acceso a la red en nuestro país\".</p>\r\n<p>También se evaluó la percepción que se tiene de los portales especializados en búsqueda de empleo.  Tres de cada cuatro de los entrevistados confía en esta herramienta.</p>','2016-02-21 16:25:10','2016-02-18 16:48:40',2,4,'redes sociales, bolsas de trabajo, empleo, entrevistados, herramienta, internet, población',1,1,99,44),(17,'La informática, el trabajo del futuro mejor pagado y mayor demanda, según Facebook','la-informatica-el-trabajo-del-futuro-mejor-pagado-y-mayor-demanda-segun-facebook','<p>La red social lanza «TechPrep» para impulsar la formación en informática y programación, áreas en las que para el año 2020 habrá un millón de empleos solo en EE.UU.</p>\r\n<p><img src=\"/img/informatica_trabajo_mejor_pagado.jpg\" alt=\"informatica trabajo\" width=\"100%\"></p>\r\n<p>Hace tiempo que Facebook dejó de ser una simple red social. Mark Zuckerberg ha sabido reinventar su creación, adaptándola a los tiempos, y haciendo de ella un elemento clave para los diferentes sectores (publicidad, comercio, ONG, etc.) con tal de conseguir conectar el mundo.</p>\r\n<p>Ahora, vuelve a sorprender a todos con «TechPrep», el nuevo centro ideado para que los grupos minoritarios puedan aprender más de la ciencia de la computación y programación informática, con todo tipo de recursos, para ayudarles desde el inicio de cara a su futuro.</p>\r\n<p>¿Quieres ser ingeniero de software? ¿O prefieres dedicarte al mundo de las aplicaciones? Quizás te interese más el área de seguridad. Estos son solo algunos de los empleos relacionados con la programación, un sector clave para la creación de empleo.</p>\r\n<p>Según Facebook, los ordenadores seguirán siendo una parte cada vez más importante de nuestra vida porque están detrás de los dispositivos que usamos para explorar contenido, comunicarnos, trabajar y jugar. Pero no solo eso. La tecnología es también fundamental en el área de la automoción, medicina, transporte, cine, etc</p>\r\n<p>De hecho, según Facebook, basándose en datos de la Oficina de Estadísticas Laborales de los EE.UU., en el año 2020 habrá un millón de empleos en programación. Se trata de una opción profesional muy bien remunerada y cada vez más demandada.</p>\r\n<p>Ante este panorama, Facebook ha ideado «TechPrep» en base a la diversidad cognitiva «porque trae gente de diferentes características para construir mejores productos que benefician a casi 1.5 mil millones de personas en todo el mundo», asegura. Es decir, dentro de una cultura inclusiva, Facebook se dio cuenta de la falta de exposición en ciencias de la computación y carreras en tecnología, así como la falta de recursos para padres, representantes y demás minorías que quieren aprender más, especialmente en varios grupos minoritarios, incluyendo las comunidades negra y latina que, sin embargo, están muy interesadas en este sector.</p>\r\n<p>Ahora, con «TechPrep», estos grupos minoritarios pueden formarse en este área profesional. «El bajo conocimiento de informática en los negros e hispanos es motivo de un menor acceso a programas en computación y es una razón para abandonar la universidad», asegura Facebook.</p>\r\n<p>¿Sabías que el salario inicial anual medio de un programador en EE.UU. es de 62.000 dólares (unos 54.000 euros)? Y lo mejor de todo es que los programadores no solo trabajan para compañías de tecnología, sino en cualquier sitio donde haya ordenadores o dispositivos electrónicos.</p>','2016-02-21 16:26:29','2016-02-04 16:49:49',2,2,'Informática, trabajo, futuro, remunerado, demanda, programación, Facebook, conocimientos, computación',1,1,71,42),(18,'China prohibe páginas web con contenidos ilegales','china-prohibe-paginas-web-con-contenidos-ilegales','<p>El regulador de internet de China informó hoy jueves de que ha prohibido cientos de páginas web y cuentas con contenidos ilegales, incluidos pornografía, juegos de azar, terrorismo, entre otros.</p>\r\n<p><img src=\"/img/china-internet.jpg\" alt=\"china\" width=\"100%\" height=\"50%\"></p>\r\n<p>La Administración del Ciberespacio de China (ACCh) señaló que las páginas web prohibidas incluyen una plataforma para el comercio ilegal de armas de fuego, algunas que produjeron rumores o distorsionaron la historia y otras de reclutamiento ilegal de estudiantes o de expedición de títulos falsos.</p>\r\n<p>También se han prohibido cuentas que inventan información sobre los mercados bursátil e inmobiliario.</p>\r\n<p>La ACCh pidió al público que informe sobre contenidos ilegales. Ante la llegada de la Fiesta de Primavera, han aumentado los rumores sobre la seguridad alimentaria, la salud pública y los transportes.</p>','2016-02-21 16:27:27','2016-02-04 16:54:50',2,3,'China, páginas web, contenido, ilegales, internet, prohibición, información',1,1,71,45),(19,'Mujeres irrumpen en la informática con su talento','mujeres-irrumpen-en-la-informatica-con-su-talento','<p>Cuando Melania González estaba en la universidad, le tocó ser la única mujer en un grupo de 40 estudiantes de Ingeniería en Computación.</p>\r\n<p><img src=\"/img/mujeres_info.jpg\" alt=\"mujeres infor\" width=\"100%\"></p>\r\n<p>En un curso, “el profesor puso un ejercicio en la pizarra y quería que lo resolviéramos ahí. Por bien o por mal, él dijo: ‘Primero, las mujeres’ y tuve que pasar al frente. Me expuso.</p>\r\n<p>”Esas situaciones te obligan a representar al resto de tu género, porque, si ya no lo hiciste bien, van a pensar que todas las mujeres no lo hacen bien”, recordó la joven, hoy de 29 años.</p>\r\n<p>Esta es solo una anécdota para Melania González, quien lidera un grupo de 30 personas (todos hombres) en Prodigious Latin America , una empresa dedicada a la producción digital y el desarrollo web.</p>\r\n<p>Sin embargo, su historia brinda una idea de las presiones y los obstáculos con que se enfrentan las mujeres que deciden ingresar a carreras de ciencia, tecnología, ingeniería o matemática (STEM, por sus siglas en inglés).</p>\r\n<p>El mismo Estado de la ciencia, la tecnología y la innovación confirma que apenas un 33% de las mujeres que se desempeñaban en el campo científico-tecnológico se dedicaban a las ingenierías y a la tecnología entre los años 2013 y 2015, frente a un 67% de hombres que laboran en estas áreas.</p>\r\n<p>En ambos sentidos. Si bien aún la balanza se inclina más hacia un lado, la experiencia de González, junto a la de Ana Patricia Loáiciga y Laura Incer (dos profesionales que también trabajan en Prodigious Latin America ), demuestra que tanto el campo tecnológico como la población femenina se ven beneficiados con la incursión de mujeres en estas áreas profesionales.</p>\r\n<p>“Somos muy pocas mujeres y el campo para nosotras es grandísimo, porque aportamos cosas y a veces ni siquiera nos damos cuenta. Por ejemplo, somos más empáticas”, dijo Loáiciga.</p>\r\n<p>A ella la sedujo la informática desde que estudiaba en el Colegio Científico de Pérez Zeledón. “Me enamoré cuando me di cuenta de que yo podía hacer cualquier cosa desarrollando software . Yo pensaba en mi mamá, que era trabajadora social y todos los años tenía que hacer un cierre de casos. Eran horas y horas y yo decía: ‘Pero si esto con un software se puede solucionar’”, rememoró.</p>\r\n<p>Aunque existe el estereotipo de que hay carreras en las que algunas personas funcionan y otras no, Loáiciga está convencida de que las habilidades necesarias para optar por estas profesiones se pueden desarrollar.</p>\r\n<p>“Hay que aprender a abstraer. Debemos pensar en general y quebrar los problemas en problemitas (...). Aplicar el conocimiento en las diversas áreas; lo que le enseñan a uno no solo eso se puede hacer, hay que expandirse y conectarse. A mí eso me encanta”, destacó Ana Patricia.</p>\r\n<p> “Yo fui mamá ya siendo profesional y casada, pero si ya tienen hijos y por alguna razón no tienen a su pareja a la par, pienso que es importante que sepan que se pueden hacer las dos cosas. El ámbito tecnológico le permite a uno estar con su hijo y trabajar”, aseguró.</p>\r\n<p>La satisfacción laboral también es enorme, pues las aplicaciones que esta ingeniera de software ha desarrollado llegan a miles de usuarios en Estados Unidos y Europa.</p>\r\n<p>Para Laura Incer, es mucho lo que las mujeres pueden aportar desde puestos ingenieriles. “Nosotras prestamos atención a los detalles. Y siento que también soy muy conciliadora”.</p>\r\n<p>En esta carrera, un día nunca es igual al otro, afirma ella. “ Hay un gran reto intelectual. La informática podés estudiarla y dedicarte a diferentes áreas, no es que solo vas a desarrollar software ”, aclaró la joven. Además, citó otro incentivo para que más mujeres quieran ser ingenieras: “Es un campo en el que se gana bien”.</p>','2016-02-23 15:38:48','2016-02-23 16:04:58',2,2,'Mujer, talento, ingeniería, computación, tecnología, desarrollando, software, profesional, Prodigious Latin America',1,1,176,34),(20,'La inquietante foto de Mark Zuckerberg en el MWC que anticipa un futuro distópico','la-inquietante-foto-de-mark-zuckerberg-en-el-mwc-que-anticipa-un-futuro-distopico','<p>Fue la sorpresa de la primera jornada del Mobile World Congress (MWC). El fundado de Facebook, Mark Zuckerberg se presentó como el profeta de la realidad virtual. Una tecnología renacida que persigue hallar su sitio también a través del \"smartphone\" y que ha encontrado en Mark Zuckerberg a su defensor más tenaz.Un foto, publicada por el propio Zuckerberg en su muro de Facebook, se ha convertido en pocas horas en la imagen del Congreso. En ella se puede ver a Zuckerberg andando entre 5.000 personas que, absortas en las gafas Gear VR de Samsung, ni siquiera se dan cuenta de quién tienen a su lado hasta que éste se sube al escenario y comienza a hablar.</p>\r\n<p> </p>\r\n<p><img src=\"/img/marck-zuckerberg-facebook-barcelona-samsung.jpg\" alt=\"mark face\" width=\"100%\"></p>\r\n<p>¿Es esta imagen una alegoría de nuestro futuro? ¿Nos espera un entonces un futuro distópico? Es decir, ¿nos espera una sociedad ficticia con tendencias sociales que nos llevan a extremos dantescos?La imagen, que ya ha sido compartida más de 15.700 veces y que cuenta con más de 240.000 comentarios en la red social ha provoca la inquietud, el miedo y la sorpresa de muchos. \"No quiero vivir en un mundo como éste. Quiero ser capaz de tocar una flor, de olerla. Quiero ser capaz de abrazar a alguien y decirle que le amo. Quiero ver una puesta de sol con una lágrima en la mejilla. Quiero ser capaz de sentir la brisa en mi cara, oler el aroma al cocinar, sentir la conexión humana...\", escribe uno de los usuarios en la foto del fundador de Facebook.</p>\r\n<p><img src=\"/img/noticia_wall_e.jpg\" alt=\"wall e\" width=\"100%\"></p>\r\n<p>Ver a Zuckerberg andar entre miles de personas conectadas a sus gafas virtuales rememora películas de ciencia ficción que nunca se creyó pudieran llegar a ser una realidad. Aquel momento de la película WALL.E donde los humanos interactúan entre sí a través de pantallas holográficas; a Matrix y sus dos mundos, el real y el virtual creado por máquinas que esclavizan a los humanos; a la novela de George Orwell, \'1984\'...</p>\r\n<p>A Zuckerberg se le ha metido entre ceja y ceja esta tecnología de inmersión y ha sacado la artillería pesada para promover su adopción: Facebook es dueño de Oculus, soporta vídeos de 360 grados y emplea a cientos de ingenieros para hacer frente a los \"desafíos complejos\" que aún presenta la tecnología.Frente a quienes critican que la realidad virtual aísla del mundo físico, Zuckerberg sostuvo que su mayor potencial es precisamente social porque permitirá al usuario interactuar con personas que están lejos.</p>','2016-02-23 15:49:01','2016-02-22 05:17:53',1,5,'inquietante, foto, Mark Zuckerberg,  MWC, Facebook, realidad virtual,Congreso,Samsung, gafas virtuales',1,1,170,35),(21,'Bienvenidos a la Matrix: la era de la realidad virtual','bienvenidos-a-la-matrix-la-era-de-la-realidad-virtual','<p>Para el 2020, los usuarios pasarán miles de horas ensimismados con gafas y realidad virtual viendo videos y jugando. Llegó la nueva era.</p>\r\n<p><img src=\"/img/noticia_wizakor_4.jpg\" alt=\"matriz virtual\" width=\"100%\"></p>\r\n<p>¿Se imagina que con sólo una orden más de 1.500 personas se sumergieran en una nueva realidad bien alejada del caótico mundo que vivimos? Ya ocurrió en Barcelona. Y para los registros fue el 21 de febrero del 2016. Quizá la historia marcará esta fecha como el día que el hombre conoció la Matrix.</p>\r\n<p>De acuerdo con cifras de la consultora Superdata, en el último año y medio las empresas que ya comercializan gafas de realidad virtual han recaudado 8,8 millones de dólares. En el mismo período de tiempo alcanzaron a vender cerca de 6,1 millones de dólares en los softwares compatibles.</p>\r\n<p>La investigación también señala que alrededor del 31% de los jugadores de consola estadounidenses, planean ya obtener una PlayStation VR y que el 18 % de los jugadores de PC indican que obtendrá un Oculus Rift (empresa perteneciente a Facebook).</p>\r\n<p>Recientemente, Google reveló los resultados de sus gafas de realidad virtual. Distribuyó cinco millones de equipos. Fueron vistas más 350.000 horas de vídeo en YouTube. Y se calcula que fueron descargados 25 millones de aplicaciones para completar el ecosistema que necesita la realidad virtual para funcionar.</p>\r\n<p>Empresas consultoras calculan que en el 2020 se suministrarán 43 millones de dispositivos de realidad virtual. Con fabricantes como Google, Samsung, Microsoft y Facebook haciendo que los usuarios cada vez se interesen más por los dispositivos de realidad virtual y realidad aumentada, la humanidad dio un paso histórico.</p>\r\n<p>Falta saber si este nuevo escalón de la evolución es un paso adelante o una nueva forma de perder tiempo en otro mundo. Quizás una mejor. Por ahora, hay que aceptar que más de cinco millones de personas ya viven en la Matrix que parecía tan lejana.</p>','2016-02-23 16:00:07','2016-02-23 11:36:38',1,5,'matrix, era virtual, 2020,        Barcelona, investigacion, google, samsung, microsoft, oculus rift',1,1,134,31),(33,' ¿Por qué la letra F y J tienen una rayita en el teclado?.. Esta es la razón','por-que-la-letra-f-y-j-tienen-una-rayita-en-el-teclado-esta-es-la-razon','<p>Seguramente alguna vez lo has visto en tu teclado y te lo has preguntado. ¿Para que sirve en realidad el relieve o bulto en las teclas F y J?</p>\r\n<p>Estas señales son muy importantes ya que su función es ser una guía. Son muy útiles para poder escribir sin tener que mirar el teclado. Las rayitas de la F y de la J fueron ideadas por June E. Botich en el años 2002, para mejorar los teclados.</p>\r\n<p>Fíjate en que tus manos automáticamente se colocan de manera que tus dedos índices reposan sobre esas dos letras, o por lo menos se mantienen cerca de las letras F y J, o sea donde están los bultos.</p>\r\n<p>Con las manos colocadas de esta manera, los demás dedos deberían encajar perfectamente con las letras A, S y D (por el lado de la letra F) y J, K y L (por el lado de la letra J).</p>\r\n<p>También el numero 5 del teclado incluye el peculiar relieve, su función es también ser una referencia a la hora de teclear los números.</p>','2016-02-26 19:04:42','2016-02-26 19:18:06',2,3,'letra, f, j, rayita, teclado, relieve,  bulto, June E Botich, ',1,1,97,47),(34,'Duplicar campo con javascript','duplicar-campo-con-javascript','<p style=\"text-align: justify;\">En este ejemplo se realiza a partir de un campo para duplicar en el mismo momento que el usuario o el que interect&uacute;a con el sistema introduce los valores en el, para generar casi que automaticamente y en tiempo real la clonaci&oacute;n. Se toma en consideraci&oacute;n que deben de ir dentro un formalario o en las diferentes etiquetas:</p>\r\n<p>Lo importante de este ejemplo es el \"id\" de los campos \"input\" y el \"onkeyup\" del id=\"titulo\" el cual es el que llama a la funcion \"copiar\" dentro de las etiquetas script</p>\r\n<p>&lt;<a href=\"http://december.com/html/4/element/input.html\">input</a> type=\"text\" value=\"contenido\" /&gt;<br />&lt;<a href=\"http://december.com/html/4/element/input.html\">input</a> type=\"text\" value=\"contenido\" /&gt;</p>\r\n<div>&nbsp;</div>\r\n<div>&nbsp;</div>\r\n<div><code><input id=\"url\" class=\"form-control\" name=\"url\" required=\"\" type=\"text\" value=\"&lt;?= $url ?&gt;\" placeholder=\"Ej. noticia-de-mejor-sabor\" /></code><br /><br />function getCleanedString(cadena) {<br />// Definimos los caracteres que queremos eliminar<br />var specialChars = \"!@#$^&amp;%*()+=-[]\\/{}|:&lt;&gt;?,.&iquest;\";<br /><br />// Los eliminamos todos<br />for (var i = 0; i &lt; specialChars&gt; cadena = cadena.replace(new RegExp(\"\\\\\" + specialChars[i], \'gi\'), \'\');<br />}<br /><br />// Lo queremos devolver limpio en minusculas<br />cadena = cadena.toLowerCase();<br /><br />// Quitamos espacios y los sustituimos por _ porque nos gusta mas asi<br />cadena = cadena.replace(/ /g, \"-\");<br /><br />// Quitamos acentos y \"&ntilde;\". Fijate en que va sin comillas el primer parametro<br />cadena = cadena.replace(/[&aacute;&agrave;&auml;&acirc;&aring;]/, \'a\');<br />cadena = cadena.replace(/[&eacute;&egrave;&euml;&ecirc;]/, \'e\');<br />cadena = cadena.replace(/[&iacute;&igrave;&iuml;&icirc;]/, \'i\');<br />cadena = cadena.replace(/[&oacute;&ograve;&ouml;&ocirc;]/, \'o\');<br />cadena = cadena.replace(/[&uacute;&ugrave;&uuml;&ucirc;]/, \'u\');<br />cadena = cadena.replace(/[&yacute;&yuml;]/, \'y\');<br />cadena = cadena.replace(/[&ntilde;]/, \'n\');<br />cadena = cadena.replace(/[&ccedil;]/, \'c\');<br />return cadena;<br />}<br /><br />function copiar(origen,destino){<br />var str = origen.value;<br />var final = getCleanedString(str); <br />document.getElementById(destino).value = final;<br />}<br />[removed]</div>\r\n<p>&nbsp;</p>','2016-03-01 15:52:24','2016-02-01 17:56:46',1,1,'',1,1,53,0),(35,'Codeigniter 4 está en desarrollo','codeigniter-4-esta-en-desarrollo','<p style=\"text-align: justify;\">Una estupenda noticia para los seguidores de este framework, pese a su poca expectativa en estos &uacute;ltimos a&ntilde;os comparados con otros framewors PHP y que en algunos momentos se notaba un ligero declive y la poca aceptaci&oacute;n en la web de grandes foros, algunos de los factores se produjo debido a la ruptura entre los desarrolladores de CODEIGNITER.</p>\r\n<p style=\"text-align: justify;\">Actualmente se mantiene entre unos de los FRAMEWORK PHP favoritos por algunos programadores debido a su simplicidad en su estructura, f&aacute;cil instalaci&oacute;n y una l&iacute;nea de aprendizaje bastante sencilla y aceptable cuando se habla de c&oacute;digo fuente.</p>\r\n<p style=\"text-align: justify;\">Codeigniter 4 solo podr&aacute; ser utilizado con versiones PHP 7 o superior, algo realmente importante ya que se mantendr&aacute; con las &uacute;ltimas funcionalidades de PHP, y quedara escalabre para seguir con su desarrollo.</p>\r\n<p style=\"text-align: justify;\">Codeigniter 4 utilizar&aacute; psr4&nbsp;para la autocarga de los directorios &ldquo;system&rdquo; y &ldquo;application&rdquo;, pero &nbsp;tambi&eacute;n contar&aacute; con su propio autoloader. Otra cosa importante es que&nbsp;Codeigniter 4 seguir&aacute; utilizando composer&nbsp;para poder utilizar y cargar dependencias externas de forma sencilla al igual que lo hace en la versi&oacute;n 3.</p>\r\n<p style=\"text-align: justify;\">Codeigniter 4 tambi&eacute;n contar&aacute; con soporte para&nbsp;<a href=\"https://phpunit.de/\">PHPUnit</a>&nbsp;para la realizaci&oacute;n de tests unitarios.</p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\"><img src=\"/img/codeigniter4.png\" alt=\"codeigniter4\" width=\"100%\" /></p>\r\n<p style=\"text-align: justify;\">&nbsp;</p>\r\n<p style=\"text-align: justify;\">Tambi&eacute;n contaremos con una barra de herramientas&nbsp;(toolbar) para realizar debug&nbsp;de nuestra aplicaci&oacute;n mientras estamos desarrollando, tendremos la posibilidad de ver los tiempos reales de carga, logs de errores, consultas de base de datos, informaci&oacute;n de las vistas, cach&eacute;, el trabajo con archivos y la informaci&oacute;n de nuestras rutas.&nbsp;</p>\r\n<p style=\"text-align: justify;\">Para mas informaci&oacute;n <a href=\"https://uno-de-piera.com/codeigniter-4-esta-marcha/\" target=\"_blank\">Aqui</a></p>','2016-03-10 17:48:45','2016-03-10 08:07:46',1,2,'codeigniter4, codeigniter desarrollo, framework codeigniter,codeigniter',1,1,157,51),(36,'Perdió su pasantía en Facebook por crear una aplicación que se aprovechaba de una debilidad del Messenger','perdio-su-pasantia-en-facebook-por-crear-una-aplicacion-que-se-aprovechaba-de-una-debilidad-del-messenger','<p style=\"text-align: justify;\">&nbsp; &nbsp;Aran Khanna era un estudiante inquieto y curioso de Harvard y, como a &eacute;l, se le ocurri&oacute; dise&ntilde;ar la aplicaci&oacute;n Marauder&rsquo;s Map, (El mapa del merodeador, en castellano) como el nombre del interesante mapa de la saga de Harry Potter; pero a diferencia del creador de Facebook, esta aplicaci&oacute;n nunca lleg&oacute; a poner un pie en la red social m&aacute;s famosa del mundo.</p>\r\n<p style=\"text-align: justify;\"><img src=\"/img/facemesseng.jpg\" alt=\"img1\" width=\"100%\" /></p>\r\n<p style=\"text-align: justify;\">&nbsp; Mientras Aran esperaba para comenzar su pasant&iacute;a en la famosa empresa de Zuckerberg, Khanna desarroll&oacute; una extraordinaria extensi&oacute;n para Google Chrome bas&aacute;ndose en una falla b&aacute;sica del Facebook Messenger: ya que el servicio compart&iacute;a autom&aacute;ticamente la precisa ubicaci&oacute;n geogr&aacute;fica desde donde las personas enviaban los mensajes, mucho m&aacute;s all&aacute; de si la gente fuera amiga o no en esta red social. Por esto, podr&iacute;a decirse que pr&aacute;cticamente cualquiera pod&iacute;a acceder a dicha informaci&oacute;n, es m&aacute;s, incluso aquellos que no eran tus amigos en la plataforma.</p>\r\n<p style=\"text-align: justify;\">&nbsp; El pol&eacute;mico mapa de Khanna, pod&iacute;a detectar con un sombroso margen de error menor a nada m&aacute;s y nada menos que de un metro el lugar desde donde los mensajes eran enviados.</p>\r\n<p style=\"text-align: justify;\">&nbsp; Tan solo un d&iacute;a despu&eacute;s de que la extensi&oacute;n saliera a la luz p&uacute;blica, su futuro jefe llam&oacute; a Khanna para solicitarle que no hablara nada con la prensa. Pero d&iacute;a siguiente, le exigi&oacute; que desactivara la extensi&oacute;n, pedido al que tambi&eacute;n accedi&oacute; el estudiante, claro no sin antes publicar un post en Medium en el cual explicaba su posici&oacute;n.</p>\r\n<p style=\"text-align: justify;\">&nbsp; Un d&iacute;a m&aacute;s tarde &ldquo;mientras se preparaba para ir a la empresa, en lo que deb&iacute;a ser su primer d&iacute;a como pasante&rdquo; Khanna recibi&oacute; otra llamada: por medio de la que se enteraba que la compa&ntilde;&iacute;a hab&iacute;a decidido retirarle la oferta de la pasant&iacute;a, alegando una supuesta &ldquo;violaci&oacute;n&rdquo; del acuerdo de t&eacute;rminos y servicios de usuario de Facebook. Ese mismo d&iacute;a recibi&oacute;, tambi&eacute;n un mail desde la direcci&oacute;n de Recursos Humanos de la compa&ntilde;&iacute;a advirti&eacute;ndole que su post en Medium &ldquo;no cumpl&iacute;a con los altos est&aacute;ndares &eacute;ticos que se esperaba de sus pasantes&rdquo;.</p>\r\n<p style=\"text-align: justify;\">&nbsp; Seg&uacute;n Khanna, le dijeron que el problema no era la extensi&oacute;n de Google Chrome como tal, sino el tono del post y la manera en la que describ&iacute;a c&oacute;mo Facebook recolectaba y compart&iacute;a los datos personales de sus usuarios .</p>\r\n<p style=\"text-align: justify;\">&nbsp;De todas maneras, despu&eacute;s de esta pel&iacute;cula de amor y de gloria que causo Facebook, no todo termin&oacute; mal para Khanna. Pues finalmente pudo conseguir otra pasant&iacute;a en una startup de Silicon Valley y dijo que todos estos problemas con Facebook le sirvieron para ganar experiencia.</p>','2016-03-10 17:53:09','2016-03-10 18:09:29',2,4,'pasantía, aplicación, debilidad, messenger, estudiante, mapa, merodeador, Facebook, mensajes, ubicación',1,1,145,52),(37,'La inteligencia artificial de Google bate al campeón del mundo de Google','la-inteligencia-artificial-de-google-bate-al-campeon-del-mundo-de-google','<p style=\"text-align: justify;\">&nbsp; &nbsp; &nbsp; &nbsp;AlphaGo, un programa de inteligencia artificial dise&ntilde;ado por la subsidiaria de Google Deepmind, ha conseguido batir al campe&oacute;n de este milenario juego, el coreano Lee Se-dol, gracias al an&aacute;lisis de los datos de 100.000 juegos de jugadores humanos profesionales. La m&aacute;quina ha empleado un algoritmo que combina unas 30 millones de partidas para batir al humano en una partida que ha durado 3,5 horas.</p>\r\n<p style=\"text-align: justify;\"><img src=\"/img/juegointelig.jpg\" alt=\"juego\" width=\"100%\" /></p>\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp; El encuentro entre m&aacute;quina y humano todav&iacute;a no ha terminado y aunque Google se ha hecho con la primera partida a&uacute;n quedan otras cuatro para poderse coronar como verdadera campeona mundial de Go.</p>\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp; Lee cree que aunque el sistema inform&aacute;tico est&eacute; tremendamente desarrollado \"la intuici&oacute;n humana y los sentidos humanos son demasiado avanzados para la inteligencia artificial para ponerse al d&iacute;a. Dudo hasta qu&eacute; punto AlphaGo puede imitar este tipo de cosas\", recoge The Telegraph.</p>\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp; Google ha conseguido un hito en el avance de la inteligencia artificial al haber conseguido ganar al campe&oacute;n del mundo del ic&oacute;nico juego de mesa as&iacute;atico Go, en la que en tablero de 19 por 19 dos jugadores mueven fichas negras o blancas para conquistar el territorio del contrario rodeando sus piezas como sea posible.</p>\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp; En octubre del a&ntilde;o pasado, AlphaGo logr&oacute; derrotarlo tres veces campe&oacute;n de Europa de este juego, Fan Hui, por un contundente 5-0, un avance para el desarrollo de la inteligencia artificial que fue recogido por la revista Nature como todo un hito para este tipo de respuesta computacional.</p>\r\n<p style=\"text-align: justify;\">&nbsp;&nbsp;&nbsp; Y es que aunque en 1996 el ordenador de IBM Deep Blue consigui&oacute; batir al ajedrez a la eminencia de este deporte&nbsp;Gari Kasp&aacute;rov, el reto que supone Go para los sistemas de computaci&oacute;n es mucho mayor por la posibilidad mucho mayor de combinaci&oacute;n de movimientos y requiere un grado mayor de intuici&oacute;n que el ajedrez.</p>','2016-03-10 18:35:55','2016-03-10 20:02:52',1,5,'inteligencia, artifical, google, campeón, programa, algoritmo, juego, sistema, intuición, máquina ',1,1,149,54),(39,'Un algoritmo determina cómo les va a las parejas escuchando sus conversaciones','un-algoritmo-determina-como-les-va-a-las-parejas-escuchando-sus-conversaciones','<p>Durante los &uacute;ltimos a&ntilde;os se ha registrado un notable aumento de parejas que acuden a especialistas para mejorar su relaci&oacute;n tras periodos de crisis, malos momentos o simplemente por falta de entendimiento. Procesos terap&eacute;uticos dirigidos por un psic&oacute;logo en busca de medidas adecuadas para reconstruir la relaci&oacute;n o bien finalizarla.</p>\r\n<p>Ahora, un nuevo software podr&iacute;a permitir a los terapeutas de pareja hacer mediciones objetivas de cada comportamiento. Un equipo interdisciplinario con miembros de la Universidad del Sur de California (USC) y la Universidad de Utah, en Estados Unidos, ha desarrollado un algoritmo inform&aacute;tico capaz de predecir si la relaci&oacute;n de una pareja ir&aacute; a mejor o peor bas&aacute;ndose en el tono de voz con que se hablan.</p>\r\n<p>Para ello, seg&uacute;n explica la USC en un comunicado, los investigadores registraron cientos de conversaciones de m&aacute;s de un centenar de parejas tomadas en sesiones de terapia de matrimonio durante m&aacute;s de dos a&ntilde;os, haciendo despu&eacute;s un seguimiento de su relaci&oacute;n durante otros cinco.</p>\r\n<p>&nbsp;<img src=\"/img/parejas.jpg\" alt=\"parejas\" width=\"100%\" /></p>\r\n<p><strong>Procesando el habla</strong></p>\r\n<p>El habla constituye la forma m&aacute;s natural de comunicaci&oacute;n entre las personas, de ah&iacute; el gran inter&eacute;s por desarrollar sistemas inform&aacute;ticos capaces de procesarla y generarla de forma autom&aacute;tica. De eso se encarga el procesamiento del habla, que abarca m&uacute;ltiples m&eacute;todos y t&eacute;cnicas con una doble finalidad. Por una parte, conseguir que los ordenadores comprendan los mensajes pronunciados por los usuarios y viceversa, hacer que la m&aacute;quina emita mensajes entendibles.</p>\r\n<p>Precisamente una de esas t&eacute;cnicas de procesamiento del habla es la que han utilizado los investigadores para convertir las grabaciones con las conversaciones de las parejas en caracter&iacute;sticas ac&uacute;sticas. Eso incluye el tono, la intensidad, las fluctuaciones o el brillo entre otros muchos aspectos, como los trinos en la voz, que pueden indicar momentos de mucha emoci&oacute;n. \"Lo que se dice no es lo &uacute;nico que importa, tambi&eacute;n c&oacute;mo se dice&rdquo;, asegura Md Nasir, doctorando en la USC. La suma de todas esas caracter&iacute;sticas ac&uacute;sticas ofrece un proxy del estado comunicativo del sujeto, as&iacute; como los cambios en ese estado durante una sola terapia o a lo largo de varias sesiones.</p>\r\n<p>Esas caracter&iacute;sticas no se analizaron por separado, sino m&aacute;s bien comprobando el impacto de las de un miembro de la pareja sobre el otro durante varias sesiones de terapia. Y es que, como matiza el l&iacute;der del estudio, Shrikanth Narayanan, &ldquo;no se trata s&oacute;lo de estudiar emociones, sino el impacto de las palabras de uno en las emociones del otro&rdquo;. Por ello, analizar el comportamiento de una pareja en una sola sesi&oacute;n limita mucho el trabajo. Sin embargo, si se pueden comparar varios momentos en el tiempo, la din&aacute;mica de pareja y mirando hacia ambas partes, ayuda a identificar el curso de la relaci&oacute;n.</p>\r\n<p><strong>Resultados positivos</strong></p>\r\n<p>Una vez ajustado el software con las grabaciones de parejas, se puso a prueba con an&aacute;lisis de comportamiento hechos por expertos, que codificaron las cualidades positivas como \"aceptaci&oacute;n\" y las negativas como &ldquo;culpa&rdquo;. El equipo detect&oacute; que el estudio realizado con las voces en vivo y directo, en lugar de c&oacute;digos de conducta creados por expertos, ofreci&oacute; una visi&oacute;n mucho m&aacute;s precisa sobre el futuro de una pareja.</p>\r\n<p>Durante las pruebas, la herramienta funcion&oacute; con casi el 79 por ciento de exactitud. De hecho, el algoritmo hizo mejor trabajo pronosticando el &eacute;xito matrimonial de parejas con problemas graves que los informes proporcionados por expertos en relaciones tras las sesiones de terapia.</p>\r\n<p>El siguiente reto de los investigadores ser&iacute;a utilizar tanto el lenguaje oral como la comunicaci&oacute;n no verbal para mejorar la predicci&oacute;n sobre la eficacia de los tratamientos. Para ello se valdr&aacute;n del procesamiento de se&ntilde;ales de comportamiento, desarrollado por Narayanan para entender computacionalmente el comportamiento humano.</p>','2016-03-10 19:49:30','2016-03-09 20:36:32',2,2,'parejas, conversaciones, escuchar, especialistas, problemas, matrimonio, relación, psicólogos, investigadores, software, terapeutas, comunicación, terapias, comportamiento, análisis',1,1,168,56),(40,'Llegaron los robots que trabajarán por nosotros y cuidarán de nosotros también','llegaron-los-robots-que-trabajaran-por-nosotros-y-cuidaran-de-nosotros-tambien','<p style=\"text-align: justify; background: white;\">Estar ante los robots ilustra, aunque no se quiera, una cierta emoci&oacute;n interpretada por melodiosas sonrisas llenas de aires de futuro. Y es que no es nuevo el hecho de que las m&aacute;quinas se han vuelto a&uacute;n m&aacute;s inteligentes y amenazan con hacerse un hueco en los procesos industriales y del hogar. Una de las posibilidades m&aacute;s interesantes y atractivas ha sido siempre la capacidad de emular acciones propias de nosotros los humanos. Los robots interactivos de uso dom&eacute;stico se abren paso en m&uacute;ltiples formas, tales como:</p>\r\n<p style=\"text-align: justify; background: white;\"><img src=\"/img/robot-japon370x270.jpg\" alt=\"robots1\" width=\"100%\" /></p>\r\n<p style=\"text-align: justify; background: white;\"><strong>Camino hacia el hogar</strong></p>\r\n<p style=\"text-align: justify; background: white;\">&ldquo;Uno de los grandes retos de la ingenier&iacute;a rob&oacute;tica, espec&iacute;ficamente en el campo de la rob&oacute;tica de consumo, es aumentar en la gente la credibilidad sobre la efectividad de los robots y la notoriedad de la categor&iacute;a de los futuros robots de limpieza. Progresivamente, los consumidores se van dando cuenta de que pueden confiar en los robots dom&eacute;sticos porque cumplen lo que prometen&rdquo;, explic&oacute; Colin Angle, quien es el director general y fundador de la empresa iRobot.</p>\r\n<p style=\"text-align: justify; background: white;\">Una de las mayores aportaciones de esta empresa americana, ha sido la popularizaci&oacute;n de un aparato de limpieza, que no deja de ser una m&aacute;quina &ldquo;pensante&rdquo;, y que es visto como un asistente sumamente pr&aacute;ctico.</p>\r\n<p style=\"text-align: justify; background: white;\">La &uacute;ltima versi&oacute;n de este, el Roomba 980, permite controlarse a distancia una vez emparejado con un dispositivo matriz o principal, como por ejemplo el smartphone por medio de conexi&oacute;n wifi.</p>\r\n<p style=\"text-align: justify; background: white;\"><img src=\"/img/robohon.jpg\" alt=\"robots2\" width=\"100%\" /></p>\r\n<p style=\"text-align: justify; background: white;\"><strong>Androides m&aacute;s interactivos</strong></p>\r\n<p style=\"text-align: justify; background: white;\">Divertidos, sonrientes y habladores, son otra concepci&oacute;n que queda pendiente por mostrar en las propuestas de los robots humanoides. El ic&oacute;nico robot Peeper o RoBoHon, una creaci&oacute;n de la empresa nipona Sharp, son ejemplos de las posibilidades que ofrecen al conectarse a trav&eacute;s de un tel&eacute;fono m&oacute;vil inteligente.</p>\r\n<p style=\"text-align: justify; background: white;\">Cada vez se va mejorando la capacidad de recordar las caras de las personas (por biometria) que registra gracias a sus c&aacute;maras frontales. Y llamarlas por su nombre. El reto, en cualquier caso claro est&aacute;, es desarrollar capacidades m&aacute;s amplias en un futuro.</p>\r\n<p style=\"text-align: justify; background: white;\">En 2016 se espera que salgan al mercado robots dom&eacute;sticos de bajo costo</p>\r\n<p style=\"text-align: justify; background: white;\">&ldquo;Se estima que para este 2016 saldr&aacute;n al mercado numerosos robots de uso dom&eacute;stico a bajo costo y veremos, por un lado, la reacci&oacute;n de las personas, y por otro, las necesidades reales, por lo que promete ser un 2016 bastante interesante. Robots sin aplicaciones reales no sirven para nada&rdquo;, explica a este diario V&iacute;ctor Mart&iacute;n, director general de la firma espa&ntilde;ola Macco Robotics.</p>','2016-03-10 20:39:54','2016-03-01 20:47:05',2,5,'Robots, trabajaran, cuidaran, hogar, Android, aplicaciones, robótica, biometría, domésticos',1,1,115,57),(41,'Usan impresora 3D para hacer hormigón sostenible con CO2','Usan-impresora-3d-para-hacer-hormigon-sostenible-con-co2','<p>Desde la reconstrucci&oacute;n de Europa por la Segunda Guerra Mundial, surge el hormig&oacute;n material de construcci&oacute;n que se utiliz&oacute; para hacer calles, edificios, puentes, casas, carreteras, despu&eacute;s de 50 a&ntilde;os se ha investigado que la producci&oacute;n de este material de construcci&oacute;n supone una d&eacute;cima parte de las emisiones de gases de efecto invernadero generadas por la industria (entre otras cosas porque fabricar cemento, componente indispensable del hormig&oacute;n, genera grandes cantidades de emisiones contaminantes)</p>\r\n<p>Por otro lado, tenemos las emisiones de di&oacute;xido de carbono (CO2) que emiten las chimeneas de centrales el&eacute;ctricas de todo el mundo, y que son la mayor fuente de gases de efecto invernadero del planeta.</p>\r\n<p>En este contenido, a cient&iacute;ficos de la Universidad de California en Los &Aacute;ngeles (UCLA, EEUU) se les ha ocurrido una idea: aprovechar el CO2 de las centrales el&eacute;ctricas para elaborar hormig&oacute;n.</p>\r\n<p>Para ello, los investigadores est&aacute;n desarrollando un proceso de ciclo cerrado que incluye la captura del CO2 que emiten las plantas de energ&iacute;a, para producir con &eacute;l un nuevo material de construcci&oacute;n llamado CO2NCRETE (hormig&oacute;n de CO2).&nbsp;</p>\r\n<p><iframe src=\"//player.vimeo.com/video/157380738?title=0&amp;byline=0\" width=\"100%\" height=\"350\" allowfullscreen=\"allowfullscreen\"></iframe></p>\r\n<p>De momento, se ha comprobado que este sistema funciona muy bien en laboratorio. A esa escala, se ha logrado fabricar el nuevo material utilizando impresoras 3-D, con las que se le ha dado la forma de peque&ntilde;os cilindros. As&iacute; que ya se tiene la prueba de concepto de que esto se puede hacer. Queda pendiente lograr el aumento del volumen de producci&oacute;n para poder producir y explotar el CO2NCRETE a escala comercial.</p>\r\n<p>Los cient&iacute;ficos de la UCLA se muestran entusiasmados con su proyecto, que podr&iacute;a convertir el CO2 &ldquo;en un recurso que se puede reutilizar\". De este modo, dicen, se podr&iacute;an reducir los gases, especialmente en aquellas regiones donde las plantas el&eacute;ctricas de carb&oacute;n son abundantes,&nbsp; pero tambi&eacute;n en pa&iacute;ses como China e India, actualmente principales productores de este gas de efecto invernadero del mundo.</p>\r\n<p>En este sentido, un reto futuro si finalmente el&nbsp; sistema de producci&oacute;n del CO2NCRETE pudiera hacerse escalable ser&aacute;&nbsp; convencer a las partes interesadas&nbsp; de que puede ser beneficioso, no s&oacute;lo para el planeta, sino tambi&eacute;n para ellas.</p>','2016-03-16 10:22:43','2016-03-16 10:34:14',2,5,'Impresora 3D, hormigón, Europa, Segunda guerra mundial, CO2, gases, efecto invernadero,  científicos, UCLA',1,1,181,60);
